emoved.'=>'Коли ви ввійдете в систему, ми також встановимо декілька файлів cookie, щоб зберегти інформацію про ваш логін та налаштування екрана. Cookie-файли для входу зберігаються 2 дні, а файли cookie-файлів налаштувань екрану - 1 рік. Якщо ви виберете &quot;Запам\'ятати мене&quot;, ваш логін буде зберігатися протягом 2 тижнів. Якщо ви вийдете зі свого облікового запису, файли cookie логіну будуть видалені.','Where your data is sent'=>'Куди відправляються ваші дані','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users.'=>'Призначення використання таксономії через інтерфейс адміністрування або відвідувачами сайту.','Whether or not comments are open on the post.'=>'Чи відкриті коментарі запису.','Whether or not the post can be pinged.'=>'Чи приймає запис сповіщення.','Whether or not the post should be treated as sticky.'=>'Чи вважати запис прикріпленим.','Whether or not the post type can be viewed.'=>'Чи може тип запису бути доступним для перегляду.','Whether or not the post type should have children.'=>'Чи може цей тип запису бути батьківським.','Whether or not the taxonomy should have children.'=>'Чи може таксономія бути батьківською.','Whether or not the term cloud should be displayed.'=>'Чи повинна бути показана хмара елементів.','Whether posts of this status may have floating published dates.'=>'Чи можуть записи з цим статусом мати плаваючу дату публікації.','Whether posts of this status should be shown in the front end of the site.'=>'Чи записи цього статусу мають бути показані на зовнішній частині сайту.','Whether posts with this status should be private.'=>'Чи записи цього статусу мають бути приватні.','Whether posts with this status should be protected.'=>'Чи записи цього статусу мають бути захищені.','Whether posts with this status should be publicly-queryable.'=>'Чи записи цього статусу можуть бути запитані публічно.','Whether the content is protected with a password.'=>'Чи захищений вміст паролем.','Whethe